import{_ as e,c as a,o as t,V as o}from"./chunks/framework.YnO4XY28.js";const _=JSON.parse('{"title":"Git","description":"","frontmatter":{},"headers":[],"relativePath":"guide/git/index.md","filePath":"guide/git/index.md","lastUpdated":1731852837000}'),r={name:"guide/git/index.md"},i=o('<h1 id="git" tabindex="-1">Git <a class="header-anchor" href="#git" aria-label="Permalink to &quot;Git&quot;">​</a></h1><p><a href="https://git-scm.com/" target="_blank" rel="noreferrer">Git</a> 是一个免费开源的<strong>分布式版本控制系统</strong>，用于跟踪文件的更改，特别是源代码。它允许多个开发者协作开发项目，记录每一次代码的变更，并可以轻松地回滚到之前的版本。</p><blockquote><p>版本控制系统分为 <code>集中式</code> 和 <code>分布式</code>。</p><ul><li>集中式：svn</li><li>分布式：git</li></ul></blockquote><p>Git官方文档：<a href="https://git-scm.com/book/zh/v2" target="_blank" rel="noreferrer">https://git-scm.com/book/zh/v2</a></p><h2 id="关键概念" tabindex="-1">关键概念 <a class="header-anchor" href="#关键概念" aria-label="Permalink to &quot;关键概念&quot;">​</a></h2><h3 id="仓库-repository" tabindex="-1">仓库（Repository） <a class="header-anchor" href="#仓库-repository" aria-label="Permalink to &quot;仓库（Repository）&quot;">​</a></h3><p>一个git仓库包含项目的所有文件和历史版本信息，通常位于 <code>.git</code> 目录中。</p><h3 id="分支-branch" tabindex="-1">分支（Branch） <a class="header-anchor" href="#分支-branch" aria-label="Permalink to &quot;分支（Branch）&quot;">​</a></h3><p>分支是代码开发的独立线路。<code>master</code>（或 <code>main</code> ）是默认分支，开发人员可以创建新的分支以进行独立开发。</p><h3 id="提交-commit" tabindex="-1">提交（Commit） <a class="header-anchor" href="#提交-commit" aria-label="Permalink to &quot;提交（Commit）&quot;">​</a></h3><p>提交是对文件的快照，记录了文件的状态和更改。每次提交都有一个唯一的哈希值。</p><h3 id="暂存区-staging-area" tabindex="-1">暂存区（Staging Area） <a class="header-anchor" href="#暂存区-staging-area" aria-label="Permalink to &quot;暂存区（Staging Area）&quot;">​</a></h3><p>暂存区是一个中间区域，用来保存你想要提交的更改。</p><h3 id="工作区-working-directory" tabindex="-1">工作区（Working Directory） <a class="header-anchor" href="#工作区-working-directory" aria-label="Permalink to &quot;工作区（Working Directory）&quot;">​</a></h3><p>工作区是你当前正在工作的目录，包含所有未提交的代码。</p><h3 id="远程仓库-remote-repository" tabindex="-1">远程仓库（Remote Repository） <a class="header-anchor" href="#远程仓库-remote-repository" aria-label="Permalink to &quot;远程仓库（Remote Repository）&quot;">​</a></h3><p>远程仓库是托管在服务器上的仓库，开发者可以从中拉取或推送代码。</p>',17),n=[i];function c(d,s,h,l,p,m){return t(),a("div",null,n)}const u=e(r,[["render",c]]);export{_ as __pageData,u as default};
